    false,nt"url": null,nt"notes": "These data are selection of geographic
    and cartographic information from the 1998 TIGER/Line files detailing water features.
    This dataset includes shorelines, streams, rivers, canals, ditches, aqueducts, lakes,
    ponds, reservoirs, bays, estuaries, gulfs, sounds, seas, oceans, gravel pits, and
    quarries. Both perennial and intermittent features are included. CUGIR, The Cornell
    University Geospatial Information Repository, using US Department of Commerce, Bureau
    of the Census data, developed the GIS data set versions of 1998 Census TIGER/Line
    files for 10 coverages for each of the 62 counties in New York State.",nt"license_title":
